interface MoviesProps {
  title: string;
  movies: any;
}

export const MoviesContainer = tw.div`my-8`;
export const MoviesTitle = tw.h2`text-xl font-bold uppercase mx-8`;

export default function Movies({ title, movies }: MoviesProps) {
  return (
    <MoviesContainer>
      <MoviesTitle>{title}</MoviesTitle>
    </MoviesContainer>
  );
}
